import CarouselWithTrees from "../assets/carousel";  // Import the updated Carousel with trees

const Home = () => {
  return (
    <div>
      <Header />
      <CarouselWithTrees />  {/* Use the new Carousel component with trees */}
    </div>
  );
};

export default Home;
